CREATE TABLE lease IF NOT EXISTS(
   user_email  VARCHAR(36) NOT NULL 
  ,billboard   INTEGER  NOT NULL
  ,date_time   DATE  NOT NULL
  ,days_number INTEGER  NOT NULL
  ,payment     NUMERIC(9,2) NOT NULL
  ,PRIMARY KEY (user_email, billboard, date_time)
  ,FOREIGN KEY (user_email) REFERENCES users(email)
  ,FOREIGN KEY (billboard) REFERENCES billboard(id)
);
